INSERT INTO `a_doctor` VALUES ('1474207434229813248', 'admin', '2021-12-24 10:36:56.000000', '0', 'admin', '2021-12-24 10:49:23.919000', '陪诊员时间观念强，全程专注尽责，对患者需求响应迅速，专业表现值得称赞。 ', '30', '王海花', '本科学士', '口腔医学专业', '15.00', 'https://www.312000.net/Upfile/Face/face_69.JPG', '3级', '1473916965973266433', '口腔科', '浙江医科大学', '2012-11-14');
INSERT INTO `a_doctor` VALUES ('1474209128925761537', 'admin', '2021-12-24 10:43:40.000000', '0', 'admin', '2021-12-24 10:49:11.230000', '陪诊过程中，其引导清晰，协助挂号、取药等流程高效，展现出良好职业素养。', '31', '阮土耿', '本科学士', '口腔医学', '15.00', 'https://www.312000.net/Upfile/Face/face_68.JPG', '1级', '1473916965973266433', '口腔科', '温州医科大学', '2015-11-30');
INSERT INTO `a_doctor` VALUES ('1474209351492308993', 'admin', '2021-12-24 10:44:33.000000', '0', 'admin', '2021-12-24 10:48:53.544000', '面对患者疑问耐心解答，服务细致入微，在各环节衔接上处理得极为妥当。', '32','杨秋婷','专科','眼科学', '15.00', 'https://www.312000.net/Upfile/Face/face_86.JPG', '4级', '1473917353262714880', '眼科', '浙江医科大学', '2014-12-02');
INSERT INTO `a_doctor` VALUES ('1474209523051925505', 'admin', '2021-12-24 10:45:14.000000', '0', 'admin', '2021-12-24 10:48:38.268000', '陪诊员熟悉医院布局，精准规划路线，极大节省患者时间，工作能力突出。', '41', '王琼', '本科学士', '眼视光', '15.00', 'https://www.312000.net/upload/dept/5066af47-a4fc-4416-94f0-643c5ccaf21a/image/20200507/390cbc01-c1f4-40e9-a4a4-78a497cdbdc9.jpg', '2级', '1473917353262714880', '眼科', '温州医科大学', '2016-12-07');
INSERT INTO `a_doctor` VALUES ('1474210972439810049', 'admin', '2021-12-24 10:51:00.020000', '0', null, null, '全程贴心陪伴，关注患者情绪变化并及时安抚，展现出高度的人文关怀。', '44', '刘平', '本科学士', '肿瘤专业', '15.00', 'https://www.312000.net/Upfile/Face/face_89.JPG', '1级', '1473918021696360449', '耳鼻咽喉科', '浙江大学', '2015-12-08');
INSERT INTO `a_doctor` VALUES ('1474211316829917185', 'admin', '2021-12-24 10:52:22.119000', '0', null, null, '能熟练协助患者与医护沟通，准确传达信息，对诊疗顺利推进助力颇大。', '39', '钱宇', '博士研究生', '骨科学', '15.00', 'https://www.312000.net/Upfile/Face/face_119.JPG', '2级', '1473914763531653120', '骨科', '浙江大学医学院', '2014-12-10');
INSERT INTO `a_doctor` VALUES ('1474211559671730177', 'admin', '2021-12-24 10:53:20.011000', '0', null, null, '工作态度严谨认真，在各项手续办理中无差错，给患者十足的安全感。', '36', '何磊', '硕士研究生', '骨科', '15.00', 'https://www.312000.net/upload/dept/e58f5a7c-820b-4527-814b-d35b6d9fd7b4/image/20180117/48d2473b-2d11-46bf-a069-e1600292d806.jpg', '3级', '1473914763531653120', '骨科', '温州医科大学', '2015-12-01');
INSERT INTO `a_doctor` VALUES ('1474211803641810945', 'admin', '2021-12-24 10:54:18.179000', '0', null, null, '陪诊时对患者病情细节记录详细，为后续诊疗提供了有价值的参考。', '45', '张凯杰', '本科学士', '消化内科', '15.00', 'https://www.312000.net/Upfile/Face/face_52.JPG', '3级', '1473917781656342528', '消化内科', '上海第二军医大学', '2013-12-09');
INSERT INTO `a_doctor` VALUES ('1474212105635893249', 'admin', '2021-12-24 10:55:30.183000', '0', null, null, '积极协调各方资源，应对突发状况冷静果断，保障了陪诊服务顺利进行。', '37', '秦月花', '硕士研究生', '消化内科医学', '15.00', 'https://www.312000.net/Upfile/Face/face_48.JPG', '4级', '1473917781656342528', '消化内科', '上海长海大学', '2016-12-07');
